import React from 'react';
import {
  ScrollView,
  StyleSheet, Text, View, Button
} from 'react-native';
import ScreenTemplate from "./screenTemplate";
import ChatStyles from "../Screens/styles/chatStyles";


export default function ChatWithALibrarian() {
  return(
    <ScreenTemplate>
      <ScrollView>
        <View
            style={{
              height: 50,
              backgroundColor:'white',
              justifyContent:'center',
              borderBottomWidth:2,
              borderColor:'black',
              borderStyle:'solid'
            }}>
            <Text>Chat with a librarian!</Text>
          </View>
        <View>
          <Button title={'Chat'}></Button>
          <Button title={'Email'}></Button>
        </View>
      </ScrollView>
    </ScreenTemplate>
  )
}

